import React from 'react';

import SiswaItem from './SiswaItem';

function SiswaTable(props){
  let nodes = props.data.map((item, index) => <SiswaItem key={index} nama={item.nama} umur={item.umur} />)
  return (
    <table className="table table-striped">
      <thead>
        <tr>
          <th>Nama</th>
          <th>Umur</th>
          <th>Action</th>
        </tr>
      </thead>
      <tbody>
        {nodes}
      </tbody>
    </table>
  )
}

export default SiswaTable;
